import React from 'react';

export default class Account extends React.Component{

    #data

    constructor(login){
        super(login);
        this.#getAccount();
    }

    setData(entr){
        this.#data = entr;
    }

    #getAccount = async () => {
        try {
            const response = await fetch("http://localhost:4000/search/8");
            const jsonData = await response.json();
            this.setData(jsonData);


        } catch (error) {
            console.error(error);
        }
    };

    getAccountMainInformation(){
        console.log(this.#data);
    };
}
